    length++;
  }
  k = k % length;
  if (k === 0) {
    return head;
  }
  let newTail = head;
  for (let i = 0; i < length - k - 1; i++) {
    newTail = newTail.next;
  }
  let newHead = newTail.next;
  newTail.next = null;
  tail.next = head;
  return newHead;
};

