class Solution:
    def swapPairs(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if not head or not head.next:
            return head
        first, second = head, head.next
        prev = None
        new_head = head
        while first.next:
            second = first.next
            first.next = second.next
            second.next = first
            if prev:
                prev.next = second
            if new_head == head:
                new_head = second
            if first.next:
                prev = first
                first = first.next
        return new_head
